Movie Info: Shuddh Desi Romance (English title: Pure Desi Romance) is a 2013 Bollywood romantic comedy film directed by Maneesh Sharma and produced by Aditya Chopra. The film features Sushant Singh Rajput, Parineeti Chopra and newcomer Vaani Kapoor in leading roles. The film set in Jaipur, Rajasthan, explores the views of young generation on commitment, live-in relationships and arranged marriages as compared to love marriages in small town India. It screened in the Gala Presentation section of the 2013 Toronto International Film Festival. Upon release, the film received positive reviews from critics and positive responses from audiences.Shuddh Desi Romance was declared Hit in India by Box Office India.



